import Release from '@/assets/img/icon/paper-plane.svg'
import Audit from '@/assets/img/icon/antOutline-audit.svg'
import Alarm from '@/assets/img/icon/md-alarm.svg'
import History from '@/assets/img/icon/md-history.svg'
import Excel from '@/assets/img/icon/antOutline-file-excel.svg'
import {SendOutlined,AuditOutlined,DashboardOutlined,FileExcelOutlined,HistoryOutlined,RollbackOutlined }from '@ant-design/icons'
import React from 'react';
export const infoListArr=[
  {
    "infoStatus":"0",
    "title":"发布任务",
    "icon":()=>(<SendOutlined twoToneColor="#eb2f96"/>),
    "text":"发布任务    一键搞定"
  },
  {
    "infoStatus":"1",
    "title":"审核通知",
    "icon":()=>(<AuditOutlined />),
    // "text":"发布任务  一键搞定"
  },
  {
    "infoStatus":"2",
    "title":"临期通知",
    "icon":()=>(<DashboardOutlined />),
    // "text":"发布任务  一键搞定"
  },
  {
    "infoStatus":"3",
    "title":"拒单通知",
    "icon":()=>(<FileExcelOutlined />),
    // "text":"发布任务  一键搞定"
  },
  {
    "infoStatus":"4",
    "title":"退单通知",
    "icon":()=>(<RollbackOutlined />),
    // "text":"发布任务  一键搞定"
  },
  {
    "infoStatus":"5",
    "title":"超期通知",
    "icon":()=>(<HistoryOutlined />),
    // "text":"发布任务  一键搞定"
  }
]

export const infoListMatch=(status)=>{
 return infoListArr.find(item=>item.infoStatus===status)
}
